Vi lascio la ricetta😊e oggi me ne vado in piscina, il parco acquatico @parco_cavour ci aspetta!

Le due basi (superiore ed inferiore) sono fatte con la stessa ricetta della pasta biscotto che ho postato qualche giorno fa. Scorrette le ricette, rotolo alle fragole👍

